
interface DatabaseSelectProps {
	label: string;
}

const DatabaseSelect: React.FC<DatabaseSelectProps> = (props) => {
	return (
		<>
			<label>{props.label}</label>
			<select>
				<DatabaseSelectItem label="Firebird" value="firebird" imageSrc="" />
			</select>
			<img src="data:image/svg+xml;base64," />
		</>
	);
}

interface DatabaseSelectItemProps {
	label: string;
	value: string;
	imageSrc: string;
}

const DatabaseSelectItem: React.FC<DatabaseSelectItemProps> = (props) => {
	return (
		<option value={props.value}>
			<img src={props.imageSrc} />
			{props.label}
		</option>
	);
}

export default DatabaseSelect;